    Map.removeLayer(LayerBasemapLabels)
  }

  if (BasemapsWithLabels[basemap]) {
    LayerBasemapLabels = L.esri.basemapLayer(basemap + 'Labels')
    Map.addLayer(LayerBasemapLabels)
  }
}

